import React from "react";

export default function AlternativeCard(props) {
  const { pokemon } = props;
  console.log(pokemon[0].stats[0]);

  return (
    <div>
      <h1>Nombre del pokemon</h1>
      {pokemon.map((pokemon, idx) => {
        return (
          <div key={idx}>
            <p>{pokemon.name}</p>
          </div>
        );
      })}
    </div>
  );
}
